import React, { useEffect, useState } from 'react'
import axios from "axios"

const Data = () => {

    const [data, setData] = useState([])

    const fetchData = async () => {
        try {
            const response = await axios.get("https://raw.githubusercontent.com/UjwalNizzCorp/NizzCorp_MachineTasks/refs/heads/main/flutter_task/api/tasks.json")
            setData(response?.data)
            console.log(response)
        } catch (err) {
            console.log(err)
        }
    }

    useEffect(() => {
        fetchData()
    }, [])

    return (
        <div className="folder-container">
            {data && data.length > 0 ? (
                <div className="folder-structure">
                    {data?.map((item, index) => (
                        <div key={index} className="folder">
                            <p className="folder-date">{item?.date}</p>
                            {item?.tasks?.map((subitem, subindex) => (
                                <div key={subindex} className="task">
                                    <p className="task-title">{subitem?.title}</p>
                                    <p className="task-description">{subitem?.description}</p>
                                    <div className="subtasks">
                                        {subitem?.subtasks?.map((inner, index) => (
                                            <div key={index} className="subtask">
                                                <p className="subtask-description">{inner?.description}</p>
                                            </div>
                                        ))}
                                    </div>
                                </div>
                            ))}
                        </div>
                    ))}
                </div>
            ) : (
                <div className="no-data">No data found</div>
            )}
        </div>
    )
}
